/** @format */
import React from "react";
import { gql, useLazyQuery } from "@apollo/client";

const GET_CHARACTER_LOCATION = gql`
  query GetCharacterLocation($name: String) {
    characters(filter: { name: $name }) {
      results {
        location {
          name
        }
      }
    }
  }
`;
const SearchLocation = () => {
